//! 助记词生成账户(地址、私钥、公钥)
function newAddress(words){
	var seed = createaddress(words)
	
	return importByKey(seed)
}

function importByKey(pri){
	var add=fns.importByKey(1, pri, "a123456789a","semo")
	return "address:"+add.address+"	pri:"+add.pri+"	pub:"+add.pub
}

//! 导入私钥
function importPriKey(pri){
	var add=fns.importByKey(1, pri, "a123456789a","semo")
	return "address:"+add.address+"	pri:"+add.pri+"	pub:"+add.pub
}

function createaddress(words){
	
		var network = bitcoinjs.bitcoin.networks.bitcoin;
		var mnemonics = { "english": new Mnemonic("english") };
		var mnemonic = mnemonics["english"];
		//生成种子
		var seed = mnemonic.toSeed(words, '');
		var bip32RootKey = bitcoinjs.bitcoin.HDNode.fromSeedHex(seed, network);
		for(var j=0;j<1;j++){
			var extendedKey = bip32RootKey;
			var key = extendedKey.derive(0);
			var keyPair = key.keyPair;
			
			var privKeyBuffer = keyPair.d.toBuffer(32);
			privkey = privKeyBuffer.toString('hex');
			return privkey
		}

}

//! 离线签名
function transactionSignature(fromaddr, toaddr,amount,fee,nonce, remark,pri,pub,contractAddress) {
	
	if (contractAddress==""){
		var inputs=[];
		var input={};
		input.address=fromaddr;
		input.assetsChainId=1;
		input.assetsId=1;
		input.amount=amount+fee;
		input.nonce=nonce;
	
		inputs[0]=input;
	
		var outputs=[];
		var output={};	
		output.address=toaddr;
		output.assetsChainId=1;
		output.assetsId=1;
		output.amount=amount;
		output.lockTime=0;
	
		outputs[0]=output;
				   
		var tAssemble=fns.transactionAssemble(inputs, outputs, remark, 2)	
		var sign=fns.transactionSerialize(pri,pub,tAssemble)
		return sign
	}else{
		var inputs=[];
		var input={};
		input.address=fromaddr;
		input.assetsChainId=1;
		input.assetsId=1;
		input.amount=600000;
		input.nonce=nonce;
		input.locked=0;
	
		inputs[0]=input;
	
		var outputs=[];
		
		var contractCall = {};
		contractCall.chainId = 1;
		contractCall.sender = fromaddr;
		contractCall.contractAddress = contractAddress;
		contractCall.value = 0;
		contractCall.gasLimit =20000
		contractCall.price = 25
		contractCall.methodName = "transfer";
		contractCall.methodDesc = "";
		
		param11 =[]
		param11[0]=toaddr
		
		param22 =[]
		param22[0]=amount.toString()
		
		contractCall.args =[]
		contractCall.args[0] =param11
		contractCall.args[1] =param22
		
		remark = contractAddress+"_"+toaddr+"_"+amount.toString()
		
		var tAssemble=fns.transactionAssemble(inputs, outputs, remark, 16,contractCall)
		var sign=fns.transactionSerialize(pri,pub,tAssemble)
		return sign
	}
}

		

 
          
              
            
       
      

              
               
               
          
       